import React from 'react';  
import axios from 'axios';  
import '../Formas/listaDiretorios.css'  
import { Container, Col, Form, Row, FormGroup, Label, Input, Button } from 'reactstrap';  
class listaDiretorios extends React.Component{  
constructor(props){  
super(props)  
this.state = {  
DiretorioId:'',  
NomeDiretorio:''
}  
}   
listaDiretorios=()=>{  
  axios.get('http://localhost:52564/Api/Student/AddotrUpdatestudent/', {DiretorioId:this.state.DiretorioId,NomeDiretorio:this.state.NomeDiretorio})  
.then(json => {  
if(json.data.Status==='Success'){  
  console.log(json.data.Status);  
  alert("OK");  
//this.props.history.push('/Studentlist')  
}  
else{  
alert('NO OK');  
debugger;  
//this.props.history.push('/Studentlist')  
}  
})  
}  

handleChange= (e)=> {  
this.setState({[e.target.name]:e.target.value});  
}  

render() {  
return (  
   <Container className="App">  
    <h4 className="PageHeading">Enter Student Informations</h4>  
    <Form className="form">  
      <Col>  
        <FormGroup row>  
          <Label for="name" sm={2}>DiretorioId</Label>  
          <Col sm={10}>  
            <Input type="text" name="DiretorioId" onChange={this.handleChange} value={this.state.DiretorioId} placeholder="Enter DiretorioId" />  
          </Col>  
        </FormGroup>  
        <FormGroup row>  
          <Label for="address" sm={2}>NomeDiretorio</Label>  
          <Col sm={10}>  
            <Input type="text" name="NomeDiretorio" onChange={this.handleChange} value={this.state.NomeDiretorio} placeholder="Enter NomeDiretorio" />  
          </Col>  
        </FormGroup>  
        
      </Col>  
      <Col>  
        <FormGroup row>  
          <Col sm={5}>  
          </Col>  
          <Col sm={1}>  
          <button type="button" onClick={this.listaDiretorios} className="btn btn-success">Submit</button>  
          </Col>  
          <Col sm={1}>  
            <Button color="danger">Cancel</Button>{' '}  
          </Col>  
          <Col sm={5}>  
          </Col>  
        </FormGroup>  
      </Col>  
    </Form>  
  </Container>  
);  
}  

}  

export default listaDiretorios;
